import React, { Component } from 'react'
import { getById } from './Audi/carsData/carsDataRes';

import Box from '@mui/material/Box';
import Rating from '@mui/material/Rating';
import Typography from '@mui/material/Typography';

import { useState } from 'react';



import Aos from 'aos';
import 'aos/dist/aos.css'
import { Link } from 'react-router-dom';

import {
    MDBValidation,
    MDBInput,
    MDBBtn,
    MDBCheckbox
} from 'mdb-react-ui-kit';

export class carS extends Component {

    state = {
        shippingPrice: 1354,
        loading: true,
        product: {}
    }

    componentDidMount() {
        var RandomNumber = Math.floor(Math.random() * 500) + 200;
        const id = this.props.match.params.id;
        getById(id)
            .then(product => {
                setTimeout(() => {
                    this.setState({
                        product,
                        loading: false
                    });
                }, RandomNumber);
            })

        Aos.init();
    }





    render() {



        if (this.state.loading)
            return <div class="mt-5 pt-5 pb-5 mb-5" ><div class="loader text-center m-auto"></div></div>;
        return (
            <div>
                <div className="container mb-5 mt-5">
                    <div className="row">
                        <div className="col-lg-7">
                            <p className="mt-4">Model : {this.state.product.Model}</p>

                            <h2>{this.state.product.name}</h2>
                            <h4>${parseInt(this.state.product.price)}</h4>

                            <p>Shipping : {"$" + this.state.shippingPrice}</p>

                        </div>
                        <div className="col-lg-5 mt-5 mb-5">
                            <h3>Total Price :</h3>
                            <h4>${parseInt(this.state.product.price) + this.state.shippingPrice}</h4>
                        </div>
                    </div>

                    <div className="mt-5 pt-5">
                        <ValidateForm />
                    </div>

                </div>


            </div>
        )
    }
}



function ValidateForm() {

    const [formValue, setFormValue] = useState({
        fname: 'Mark',
        lname: 'Otto',
        email: '',
        city: '',
        state: '',
        zip: '',
    });

    const onChange = (e) => {
        setFormValue({ ...formValue, [e.target.name]: e.target.value });
    };

    return (
        <MDBValidation action="/Done" className='row g-3' noValidate>
            <div className='col-md-4'>
                <MDBInput
                    name='fname'
                    id='validationCustom01'
                    required
                    label='First name'
                    validation='Looks good!'
                />
            </div>
            <div className='col-md-4'>
                <MDBInput
                    name='lname'
                    id='validationCustom02'
                    required
                    label='Last name'
                    validation='Looks good!'
                />
            </div>
            <div className='col-md-4'>
                <div className='input-group has-validation'>
                    <span className='input-group-text' id='inputGroupPrepend'>
                        @
                    </span>
                    <input
                        type='text'
                        className='form-control'
                        id='validationCustomUsername'
                        placeholder='Username'
                        required
                    />
                    <div className='invalid-feedback'>Please choose a username.</div>
                </div>
            </div>
            <div className='col-md-6'>
                <MDBInput
                    name='city'
                    id='validationCustom03'
                    required
                    label='City'
                    validation='Please provide a valid city.'
                    invalid
                />
            </div>
            <div className='col-md-6'>
                <MDBInput
                    name='zip'
                    id='validationCustom05'
                    required
                    label='Zip'
                    validation='Please provide a valid zip.'
                    invalid
                />
            </div>
            <div className='col-12'>
                <MDBCheckbox
                    label='Agree to terms and conditions'
                    id='invalidCheck'
                    validation='You must agree before submitting.'
                    invalid
                    required
                />
            </div>
            <div className='col-8 mt-5'>
                <MDBBtn type='submit'>Submit form</MDBBtn>
            </div>
        </MDBValidation>
    );
}



export default carS
